INSERT INTO `preguntas` (`id`, `id_cuestionario`, `texto_pregunta`, `orden_pregunta`, `peso_pregunta`, `imagen_pregunta`, `nombre_imagen_pregunta`) VALUES
(1, 1, '¿Cuanto es 2+2?', 0, 150.00, NULL, NULL),
(2, 1, 'Responda 1-1+2/1*1', 1, 150.00, NULL, NULL),
(3, 2, 'En las crisis en la familia se emplean mecanismos para afrontarlas, como lo son las redes de apoyo. Haciendo énfasis en el desplazamiento forzado, como la crisis que compromete el núcleo familiar, en muchos casos afronta diversas pérdidas dentro de la familia y de las redes de apoyo, así como la inmersión en comunidades nuevas y desconocidas, unido a la carencia económica. ¿Cuál de los siguientes NO es un Indicador específico de una crisis familiar?', 0, 9.49, NULL, NULL),
(4, 2, 'Laura y Juan son hermanitos, sus padres difícilmente mantiene en casa, Orlando el padre trabaja desde las 5 am hasta las 8. 00 pm, al igual que su madre Alicia; familia nuclear formada por 4 personas. Laura y Juan mantienen juntos en casa siempre esperando a sus padres, sin embargo, cuando llegan sus padres constantemente riñen en presencia de Laura y Juan. Orlando el padre siempre le reclama a Alicia sobre las cosas que debería cumplir cuando no mantiene en casa, por lo general Orlando golpea a la madre en presencia de ellos, los niños tapan los oídos evitando escuchar más las constantes reclamaciones de sus padres. En la escuela el niño Juan mantiene en riña con los demás compañeritos mientras que Laura mantiene retraída y con bajo rendimiento académico. De acuerdo con la descripción anterior, se está ante un caso de maltrato que evidencia violencia de tipo', 1, 12.56, NULL, NULL),
(5, 2, 'Durante la visita domiciliaria a la familia Martinez González compuesto por mamá de 55 años, papá de 60 años y dos hijos de 21 y 19 años, respectivamente, como trabajador del área de la salud usted identifica factores de riesgo familiar asociados a enfermedades cardiovasculares y diabetes no controladas ambas por antecedentes maternos. Usted debe orientar un plan para fomentar estilos de vida saludable teniendo en cuenta los factores de riesgo y para ello le sugiere a la familia', 2, 17.67, NULL, NULL),
(6, 2, 'Un sistema de salud basado en la atención primaria, orienta sus estructuras y funciones hacia los valores de la equidad y la solidaridad social, y el derecho de todo ser humano a gozar del grado máximo de salud que se pueda lograr sin distinción de raza, religión, ideología política o condición económica o social. Para lograr su implementación, la prioridad seria', 3, 20.28, NULL, NULL),
(7, 2, 'Al traer los hijos al mundo mediante la procreación, la familia se encuentra íntimamente relacionada con la defensa de la vida, ya que la familia asegura la continuidad de la especie, vela por la salud física y mental de sus miembros, desarrollando acciones de cuidado y protección. El enunciado se refiere a', 4, 9.49, NULL, NULL);
INSERT INTO `preguntas` (`id`, `id_cuestionario`, `texto_pregunta`, `orden_pregunta`, `peso_pregunta`, `imagen_pregunta`, `nombre_imagen_pregunta`) VALUES
(8, 2, 'El familiograma es una herramienta que valora las relaciones intrafamiliares. Al analizar el siguiente familiograma se puede decir que la tipología de esta familia es', 5, 12.56, , 'form-medicina.png');
INSERT INTO `preguntas` (`id`, `id_cuestionario`, `texto_pregunta`, `orden_pregunta`, `peso_pregunta`, `imagen_pregunta`, `nombre_imagen_pregunta`) VALUES
(9, 2, 'El APGAR es un instrumento que permite la valoración de la funcionalidad intrafamiliar, fundamental en el estudio de la dinámica familiar. El componente que hace referencia al crecimiento dentro de esta herramienta está relacionado con', 6, 17.67, NULL, NULL),
(10, 2, 'Al observar en una Institución Educativa la dificultad de las relaciones entre los estudiantes, mediadas por actos de violencia y agresión, incluso con los docentes, deciden implementar un proyecto de intervención, con el fin de dar solución a la problemática. La mejor forma de socializar el proyecto con los estudiantes y lograr su participación sería', 7, 20.28, NULL, NULL),
(11, 2, 'El enunciado que dice que el médico, no importa si el usuario es un hipertenso o un asmático, el deberá considerar a la persona total en toda su dimensión, en su contexto familiar y comunitario, reconocer las emociones incluyendo las propias y comprender las relaciones del paciente con su familia y con el médico. Hace referencia al modelo de atención', 8, 9.49, NULL, NULL),
(12, 2, 'El familiograma es una herramienta que valora las relaciones intrafamiliares. Posterior al análisis del siguiente familiograma describa el ciclo vital familiar según la OMS de Bohg y Valeria', 9, 12.56, , 'form-medicina2.jpg');
INSERT INTO `preguntas` (`id`, `id_cuestionario`, `texto_pregunta`, `orden_pregunta`, `peso_pregunta`, `imagen_pregunta`, `nombre_imagen_pregunta`) VALUES
(13, 2, 'El familiograma es un instrumento de evaluación familiar que se utiliza en la medicina familiar para representar en forma esquemática la familia proveyendo información sobre sus integrantes, relaciones y estructura. Posterior al análisis del siguiente familiograma, responda las siguientes preguntas: Señale los errores que usted observa en la diagramación del familiograma', 10, 17.67, , 'form-medicina3.jpg'),
(14, 2, 'La Dra. Rodríguez, médica de familia, está atendiendo a una pareja, Juan y Ana, que han decidido adoptar a un niño. Han pasado por un proceso de adopción exitoso y están emocionados, pero también preocupados por cómo abordar la adaptación del niño a su nuevo entorno familiar. El niño, Carlos, de 5 años, ha estado en diferentes hogares de acogida antes de ser adoptado por Juan y Ana. Durante la consulta, Juan y Ana mencionan que Carlos parece retraído y tiene dificultades para comunicarse. Una estrategia clave para abordar la adaptación de Carlos a su nueva familia adoptiva es', 11, 20.28, NULL, NULL),
(15, 2, 'La promoción de la salud permite que las personas tengan un mayor control de su propia salud. Abarca una amplia gama de intervenciones sociales y ambientales destinadas a beneficiar y proteger la salud y la calidad de vida individuales mediante la prevención y solución de las causas primordiales de los problemas de salud, y no centrándose únicamente en el tratamiento y la curación. Es un componente esencial de la promoción de la salud', 12, 9.49, NULL, NULL),
(16, 2, 'Según Erik Erikson desde el nacimiento hasta la vejez pasamos por 8 conflictos que permiten el desarrollo psicosocial y personal del individuo. Según Erikson, las fuerzas distónicas en el individuo hacen referencia a', 13, 12.56, NULL, NULL),
(17, 2, 'El contexto de la medicina familiar se centra en la atención integral, continua y centrada en el paciente en el nivel de atención primaria de salud. Los médicos de familia desempeñan un papel esencial en la prevención, diagnóstico y tratamiento de enfermedades, así como en la promoción de la salud en un entorno que considera las necesidades y circunstancias individuales de los pacientes. Las siguientes es una característica esencial de la atención familiar', 14, 17.67, NULL, NULL),
(18, 2, 'Es usted un médico de familia tratando a la paciente, María, que ha estado experimentando síntomas de depresión. María menciona que ha tenido dificultades en su familia y se siente aislada. Como médico decide utilizar un instrumento para evaluar la dinámica familiar y la posible influencia de los factores familiares en la depresión de María. Para ello la mejor opción es', 15, 20.28, NULL, NULL),
(19, 2, 'La estructura familiar es un sistema dinámico de relaciones sociales, que hace referencia al tamaño y composición de la familia, por lo tanto, una familia integrada por una pareja, con un hijo de 9 años y tres sobrinos de 5,6 y 8 años se clasifica como', 16, 9.49, NULL, NULL),
(20, 2, 'En el ámbito de la medicina familiar, el entendimiento de las diferentes etapas del ciclo de vida de una familia es esencial para brindar una atención de salud efectiva y centrada en el paciente. Cada etapa del ciclo de vida familiar presenta desafíos y dinámicas únicas que pueden influir en la salud y el bienestar de sus miembros. Por lo cual, la característica que mejor describe a una familia madura es', 17, 12.56, NULL, NULL),
(21, 2, 'El Dr. Martínez, un médico de familia, está atendiendo a un paciente, Carlos, de 65 años, quien se acerca a su consulta con preocupaciones sobre su salud en relación con su reciente jubilación. Carlos ha sido recientemente jubilado de su trabajo después de décadas de empleo. Durante la consulta, menciona sentirse ansioso y preocupado por cómo estructurar su vida ahora que ya no está trabajando. También menciona que ha notado un aumento en su presión arterial y dificultades para dormir desde su jubilación. Un aspecto clave a considerar al abordar la situación de Carlos es', 18, 17.67, NULL, NULL),
(22, 2, 'Un médico de familia está tratando a un paciente, Juan, que ha sido diagnosticado con diabetes tipo 2. Durante la consulta, Juan menciona que vive solo y está lidiando con la gestión de su enfermedad. El médico decide utilizar un instrumento para evaluar el entorno y las relaciones sociales de Juan, así como su apoyo familiar.', 19, 20.28, NULL, NULL);

